from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
motor = Motor(Port.A, Direction.CLOCKWISE)
motor2 = Motor(Port.B, Direction.COUNTERCLOCKWISE)
front = Motor(Port.E, Direction.COUNTERCLOCKWISE)
back = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(motor2, motor, 81.6, 101.7)

async def Run_1():
    await wait(1)
    await complete_octopie_and_shippy()
    await right_side_collection()
    await angular_fish()

async def complete_octopie_and_shippy():
    await wait(1)
    await drive_base.turn(10)
    drive_base.settings(straight_speed=350)
    await drive_base.straight(-300)
    drive_base.settings(straight_speed=100)
    await drive_base.straight(-100)
    # octopie collected
    drive_base.reset()
    await multitask(front.run_angle(500, 60), drive_base.straight(25))
    drive_base.settings(straight_speed=400)
    await drive_base.curve(105, -100)
    drive_base.reset()
    await drive_base.straight(80)
    await front.run_angle(350, -370)
    # shippy lane done
    drive_base.settings(straight_speed=500)
    drive_base.settings(turn_rate=150)
